:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Margaret Ellen and MACLEAN, Christopher Haydon
  IMACLEAN, William Haydon and McBETH, Keitha Kate Florence
  IMACLEAN, Margaret Joan and ANDREWS, Frederick Robert William
  VANDREWS, Keitha Susan and PAINE, Niven Charles
  ANDREWS, Keitha Susan and PAINE , Niven Charles (cont...)
  Niven is a systems consultant currently employed as Communications Manager at Valley Diagnostic
  Laboratories, Lower Hutt. He trained as a medical laboratory scientist and completed a Diploma of
  Business Administration at Victoria University (1986).
  Susan's interests include music, both orchestral and choral. She is a member of the Orpheus Choir
  and St James' Church Choir, Lower Hutt and is the current librarian for the Orpheus Choir. Niven's
  interests include woodturning and involvement in information technology issues. Both are keen on
  gardening.
  01> PAINE, David Charles Haydon
  b 05.04.1972
  David b. at Lower Hutt. Address: 32 Santiago Crescent, Glenfield, Auckland.
  David was educated at Hutt Valley High School and completed a BCA at Victoria University and a
  NZCE at the Central Institute of Technology, Heretaunga. He is currently employed as a systems
  engineer at Macro Automation in Auckland. His interests include information technology and
  automobiles.
  02> PAINE, Fiona Margaret
  b 29.10.1973
  Fiona b. at Lower Hutt. She was educated at Hutt Valley High School and completed a National
  Diploma of Hospitality Management at the Central Institute of Technology, Heretaunga. She is
  currently employed as a hospitality manager with Condor Ferries of Guernsey based in Poole,
  England. Her interests include travel, theatre and aerobics.
  03> ANDREWS, Elizabeth Ellen m on 09.09.1967 to BOURN, Christopher James
  b 01.03.1945
  b 26.07.1938
  Elizabeth b. at Wellington and m. at St Thomas' Church, Newtown, Wellington, Christopher, slo
  Norman Charles Bourn and Kathleen Wilson Stuart, b, at Wanganui. Address: 20 Wendover Road,
  Glendowie, Auckland.
  Elizabeth was educated at Lyall Bay School and Wellington East Girls' College. She joined Radio New
  Zealand in 1963, then became one of TVNZ's early announcers, remaining with them for 17 years. She
  performed in many theatrical productions with the Wellington Operatic Society and Hutt Repertory
  and continued that interest in Auckland at Mercury Theatre and North Shore and Howick Operatic
  Societies. She became a Christian in 1991 and is very active in her church, Eastern Bays Christian
  Fellowship at Mission Bay where she is currently serving as a deacon.
  Christopher was educated at Stratford Technical High School and Palmerston North Teachers' College.
  He was a primary school teacher for 7 years before joining Television NZBC in 1964 as a producer of
  sport and entertainment programmes. He became Head of Presentation, Promotion and Publicity then
  Head of Entertainment and Head of Video Production. In 1993 he joined Tiger Films as
  Producer/Director,
  01> BOURN, Simon Charles m on 14.02. 1992 to CAMERON, Heather Janet
  Robert
  b 05.12.1969
  b 15.12.1970
  Simon b. at Wellington and m. at St David's Church, Hamilton. Heather, d/o Neil and Linda
  Temple Cameron, b. at Te Kuiti.
  Simon was educated at Eastern Hutt School and Hutt Valley High School where he was Head Boy
  then graduated BA from Auckland University. He taught English as a foreign language at the
  International Academy of Languages in Auckland before studying for two years with Heather at
  Bethany College of Missions in Minnesota, USA. On returning, he took up a teaching position at
  Languages International in Auckland and has also taken on Assistant Pastorship at Eastern Bays
  Christian Fellowship at Mission Bay, Auckland.
  (cont...)
